import React, { Component } from 'react';
import "../styles/Home.scss";
import Download from "../assets/icon/Download-icon.svg";
import Device from "../assets/icon/Cardiogram-icon.svg";
import Notification from "../assets/icon/Notification-icon.svg";

class Home extends Component {


  render() {

    const Columns = () => 
    <div class="col" style={{ display: "grid", gridTemplateColumns: "repeat(3, 1fr)", gridGap: 20 }}>
      <div>
      <img src={Download} />
      </div>
      <div>
      <img src={Device} />
      </div>
      <div>
      <img src={Notification} />
      </div>
    </div>

  return (
    <div id="home">
      <h1>Discover <span>safer</span> medical devices.</h1>
      <Columns />
    </div>
  );
  }
}

export default Home;
